We can check out the examples examples/capture_send.rs and examples/capture_recv.rs to see a paired use of capture and receive demonstrating the generality. The capture_send example creates a new TCP connection for each worker, which it wraps and uses as an EventPusher. Timely dataflow takes care of all the serialization and stuff like that (warning: it uses abomonation, so this is not great for long-term storage). extern crate timely; use std::net::TcpStream;
use timely::dataflow::operators::ToStream;
use timely::dataflow::operators::capture::{Capture, EventWriter}; fn main() { timely::execute_from_args(std::env::args(), |worker| { let addr = format!("127.0.0.1:{}", 8000 + worker.index()); let send = TcpStream::connect(addr).unwrap(); worker.dataflow::<u64,_,_>(|scope| (0..10u64) .to_stream(scope) .capture_into(EventWriter::new(send)) ); }).unwrap();
} The capture_recv example is more complicated, because we may have a different number of workers replaying the stream than initially captured it. extern crate timely; use std::net::TcpListener;
use timely::dataflow::operators::Inspect;
use timely::dataflow::operators::capture::{EventReader, Replay}; fn main() { timely::execute_from_args(std::env::args(), |worker| { let source_peers = std::env::args().nth(1).unwrap().parse::<usize>().unwrap(); // create replayers from disjoint partition of source worker identifiers. let replayers = (0 .. source_peers) .filter(|i| i % worker.peers() == worker.index()) .map(|i| TcpListener::bind(format!("127.0.0.1:{}", 8000 + i)).unwrap()) .collect::<Vec<_>>() .into_iter() .map(|l| l.incoming().next().unwrap().unwrap()) .map(|r| EventReader::<_,Vec<u64>,_>::new(r)) .collect::<Vec<_>>(); worker.dataflow::<u64,_,_>(move |scope| { replayers .replay_into(scope) .inspect(|x| println!("replayed: {:?}", x)); }) }).unwrap(); // asserts error-free execution
} Almost all of the code up above is assigning responsibility for the replaying between the workers we have (from worker.peers()). We partition responsibility for 0 .. source_peers among the workers, create TcpListeners to handle the connection requests, wrap them in EventReaders, and then collect them up as a vector. The workers have collectively partitioned the incoming captured streams between themselves. Finally, each worker just uses the list of EventReaders as the argument to replay_into, and we get the stream magically transported into a new dataflow, in a different process, with a potentially different number of workers. If you want to try it out, make sure to start up the capture_recv example first (otherwise the connections will be refused for capture_send) and specify the expected number of source workers, modifying the number of received workers if you like. Here we are expecting five source workers, and distributing them among three receive workers (to make life complicated): shell1% cargo run --example capture_recv -- 5 -w3 Nothing happens yet, so head over to another shell and run capture_send with the specified number of workers (five, in this case): shell2% cargo run --example capture_send -- -w5 Now, back in your other shell you should see something like shell1% cargo run --example capture_recv -- 5 -w3 replayed: 0 replayed: 1 replayed: 2 replayed: 3 replayed: 4 replayed: 5 replayed: 0 replayed: 6 replayed: 1 ... which just goes on and on, but which should produce 50 lines of text, with five copies of 0 .. 10 interleaved variously.

