The ExchangeData trait is more complicated, and is established in the communication/ module. The trait is a synonym for Send+Sync+Any+serde::Serialize+for<'a>serde::Deserialize<'a>+'static where serde is Rust's most popular serialization and deserialization crate. A great many types implement these traits. If your types does not, you should add these decorators to their definition: # extern crate serde;
