Communication in timely dataflow starts from the timely_communication crate. This crate includes not only communication, but is actually where we start up the various worker threads and establish their identities. As in timely dataflow, everything starts by providing a per-worker closure, but this time we are given only a channel allocator as an argument. Before continuing, I want to remind you that this is the internals section; you could write your code against this crate if you really want, but one of the nice features of timely dataflow is that you don't have to. You can use a nice higher level layer, as discussed previously in the document. That being said, let's take a look at the example from the timely_communication documentation, which is not brief but shouldn't be wildly surprising either. extern crate timely_bytes;
extern crate timely_communication; use timely_communication::{Allocate, Bytesable}; /// A wrapper that indicates the serialization/deserialization strategy.
pub struct Message { /// Text contents. pub payload: String,
} impl Bytesable for Message { fn from_bytes(bytes: timely_bytes::arc::Bytes) -> Self { Message { payload: std::str::from_utf8(&bytes[..]).unwrap().to_string() } } fn length_in_bytes(&self) -> usize { self.payload.len() } fn into_bytes<W: ::std::io::Write>(&self, writer: &mut W) { writer.write_all(self.payload.as_bytes()).unwrap(); }
} fn main() { // extract the configuration from user-supplied arguments, initialize the computation. let config = timely_communication::Config::from_args(std::env::args()).unwrap(); let guards = timely_communication::initialize(config, |mut allocator| { println!("worker {} of {} started", allocator.index(), allocator.peers()); // allocates a pair of senders list and one receiver. let (mut senders, mut receiver) = allocator.allocate(0); // send typed data along each channel for i in 0 .. allocator.peers() { senders[i].send(Message { payload: format!("hello, {}", i)}); senders[i].done(); } // no support for termination notification, // we have to count down ourselves. let mut received = 0; while received < allocator.peers() { allocator.receive(); if let Some(message) = receiver.recv() { println!("worker {}: received: <{}>", allocator.index(), message.payload); received += 1; } allocator.release(); } allocator.index() }); // computation runs until guards are joined or dropped. if let Ok(guards) = guards { for guard in guards.join() { println!("result: {:?}", guard); } } else { println!("error in computation"); }
} There are a few steps here, and we'll talk through the important parts in each of them.

