The Bytesable trait that we impose on all types that we exchange is a "marker trait": it wraps several constraints together, like so pub trait Exchangeable : Send+Any+Bytesable { }
impl<T: Send+Any+Bytesable> Exchangeable for T { } These traits are all Rust traits, except for Bytesable, and they mostly just say that we can send the data around. The Bytesable trait is something we introduce, and asks for methods to get into and out of a sequence of bytes. pub trait Bytesable { fn into_bytes(&mut self, &mut Vec<u8>); fn from_bytes(&mut Vec<u8>) -> Self;
